INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8805957018748', 'Aloe vera', 'CORÉE Saveurs du Matin Calme Votre hôte Maison de Corée vous présente sa sélection de cuisine coréenne haut de gatnme. Nous vous invitons à découvrir le goût authentique de la cuisine coréenne, élaborée dans l\'esprit de la tradition. Histoire de la boisson à l\'Aloe Vera L\'Aloe vera a de nombreux bienfaits pour la santé. L\'Aloe est une plante utilisée depuis longtemps par la méde- Cine traditionnelle, procurant de la force et de la vitalité Dans l\'Égypte ancienne, on l\'utilisait comme médicament. Hippocrate soignait également ses patients avec de l\'Aloe. En effet, cette plante était déjà connue pour son action sur le système immunitaire, le système gastro-intestinal (en particulier pour lutter contre la constipation), et sur la circulation sanguine. Depuis 30ans, la Corée du Sud est le premier pays qui a produit des boissons à l\'Aloe Vera, qui sont aujourd\'hui appréciées dans le monde entier.', 'https://static.openfoodfacts.org/images/products/880/595/701/8748/front_fr.4.400.jpg', '1', '1', '6.3', '5.8', '0.6', '0', '0', '0', '', '1');

